import React from 'react';
class Data extends React.Component{
    constructor(props){
       super(props)
        this.state={
            dataEl:[]
        }
    }
    data=()=>{
        let something=fetch('http://restcountries.eu/rest/v2/all')
        .then((response) => {
          return response.json();
        })
        .then((data) => {
          console.log(data);
        })
        .catch((error)=>{
            return "error"
        });

        this.setState({ dataEl: something });

    }
    render(){

        return(<div>
        <button onClick={this.data}>data</button>
        <p>{this.state.dataEl.map((data)=>data)}</p>
        </div>)
    }
}
export default Data;
